import './Products.css'
import { ItemCard } from '../ItemCard/ItemCard'

export const Products = ( { products} ) =>{

    return(
        <div className='Products'>
            <div>
                
            </div>

            {products.map( product => (
                <ItemCard
                    key={product.id}
                    category={product.category} 
                    id={product.id}
                    thumbnail={product.thumbnail}
                    title={product.title}
                    brand={product.brand}
                    price={product.price}
                    rating={product.rating}   
                />
            ))}
        </div>
    )
}
